import React from "react";
import { Box, Divider, Input } from "native-base";

const Header = () => {
  return (
    <>
      <Box bg="bgColorDark" color="white" height="7%">
        <Input
          variant="filled"
          placeholder="Search"
          p={2}
          bg="#ECECED"
          width="15%"
          size="sm"
        />
      </Box>
      <Divider borderWidth={0.25} borderColor="gray.500" />
    </>
  );
};

export default Header;
